// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "./Ownable.sol";
import "./DigitalArt.sol";

contract RecordLabel is Ownable {
    enum DigitalArtStatus {Applied, Published, Cancelled}



    struct S_DigitalArt{
      DigitalArt digitalArt; 
      bool exists; // fill this out. 
    }
    mapping(bytes32 => S_DigitalArt) public digitalArts;

    //TODO: Make it accept ether. 
    function createDigitalArt(bytes32 _dhash) public payable {
      require(msg.value > 0, "Cannot create digital art for free");
      require(address(0) != msg.sender, "Owner must be a valid address");	
	  	require(owner() != msg.sender, "Record label cannot own a digital art");
      require(digitalArts[_dhash].exists == false, "Cannot add a digital art that already exists");

      DigitalArt _digitalArt = new DigitalArt(address(owner()), _dhash);
      _digitalArt.updateStatus(DigitalArtStatus.Applied);
      _digitalArt.transferOwnership(msg.sender);
      digitalArts[_dhash].digitalArt = _digitalArt;
      digitalArts[_dhash].exists = true;    
    }

    function searchDigitalArt(bytes32 _dhash) public view returns(DigitalArt)  {    
  		require(digitalArts[_dhash].exists, "Digital art does not exists");
      return digitalArts[_dhash].digitalArt;
     }

    function publishDigitalArt(bytes32 _dhash) public onlyOwner {
	  	digitalArts[_dhash].digitalArt.updateStatus(DigitalArtStatus.Published);
    }

    function cancelDigitalArt(bytes32 _dhash) public onlyOwner {
  		digitalArts[_dhash].digitalArt.updateStatus(DigitalArtStatus.Cancelled);
    }

    function withdrawAllFunds() public onlyOwner {
        uint amount = address(this).balance;
        (bool success,) = owner().call{value: amount}("");
        require(success, "Failed to withdraw Ether");
    }
}
